import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import ProductList from './components/ProductList';
import './App.css';

function App() {
    return (
        <Router>
            <div className="App">
                <h1>Test with Router</h1>
                <ProductList />
            </div>
        </Router>
    );
}

export default App;
